import React, { Component } from 'react';
import './qsTop.css'

class QSTop extends Component {
    render() {
        return (
            <div>
                <div className="qsHead">
                    Quick Searches
                </div>
                <div className="qsSubHead">
                    Discover restaurants by type of meal
                </div>
            </div>
        );
    }
}

export default QSTop;
